import React from 'react';
import './'

export default function Input(props) {
    function changeCity(e)
    {
        props.search(document.getElementById("input").value);
    }

    return (
        <div id="input">
            <input id="input" type="search" />
            <button onClick={changeCity}>Search</button>
        </div>
    )
}
